import React, { useState, useEffect } from 'react';
import { getAllServices, hideService } from '../api/serviceApi';
import ServiceForm from '../components/services/ServiceForm';
import AssignDoctorForm from '../components/services/AssignDoctorForm';


interface Service {
  id: number;
  title: string;
  description: string;
  price: number;
  imagePath: string;
  isHidden: boolean;
  category: {
    id: number;
    name: string;
  };
}

const AdminServicesPage: React.FC = () => {
  const [services, setServices] = useState<Service[]>([]);
  const [message, setMessage] = useState('');
  const [token, setToken] = useState<string | null>(null);
  const [selectedServiceId, setSelectedServiceId] = useState<number | null>(null);


  useEffect(() => {
    const storedToken = localStorage.getItem('token');
    if (storedToken) setToken(storedToken);

    getAllServices()
      .then(response => setServices(response.data))
      .catch(() => setMessage('Не вдалося завантажити сервіси.'));
  }, []);

  const handleHide = async (id: number) => {
    if (!token) return;

    try {
      await hideService(id, token);
      setServices(prev =>
        prev.map(s => (s.id === id ? { ...s, isHidden: true } : s))
      );
      alert('Сервіс приховано!');
    } catch (error) {
      alert('Помилка при приховуванні сервісу');
    }
  };

  return (
    <div style={{ maxWidth: '900px', margin: 'auto' }}>
      <h1>Керування Сервісами</h1>

      {message && <p style={{ color: 'red' }}>{message}</p>}

      <h3>Список Сервісів</h3>
      <table border={1} cellPadding={8} style={{ width: '100%' }}>
        <thead>
          <tr>
            <th>Фото</th>
            <th>Назва</th>
            <th>Опис</th>
            <th>Ціна</th>
            <th>Категорія</th>
            <th>Статус</th>
            <th>Дія</th>
          </tr>
        </thead>
        <tbody>
          {services.map(service => (
            <tr key={service.id}>
              <td>
                <img
                  src={`http://localhost:5000/${service.imagePath}`}
                  alt={service.title}
                  style={{ width: '100px', height: '70px', objectFit: 'cover' }}
                />
              </td>
              <td>{service.title}</td>
              <td>{service.description}</td>
              <td>${service.price}</td>
              <td>{service.category?.name || 'Без категорії'}</td>
              <td>{service.isHidden ? 'Приховано' : 'Видимо'}</td>
              <td>
                {!service.isHidden && (
                    <>
                      <button onClick={() => handleHide(service.id)}>Приховати</button>
                      <button onClick={() => setSelectedServiceId(service.id)}>Додати доктора</button>
                    </>
                )}
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      <h3>Створити новий сервіс</h3>
      {token ? (
        <ServiceForm token={token} />
      ) : (
        <p>Увійдіть, щоб створити сервіси.</p>
      )}
    </div>
  );
};

export default AdminServicesPage;
